import React, { useState, useEffect } from 'react';

const TableHeaderCell = ({ value }) => {
  return (
    <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
      {value}
    </th>
  );
};

const TableDataCell = ({ value }) => {
  return (
    <td className="px-6 py-4 whitespace-nowrap">
      {value}
    </td>
  );
};

const data = [
  {
    "id": "02008320-1d3d-423d-ba97-4f7d43a052c3",
    "koName": "급식",
    "name": "meal",
    "accessKey": "$2a$10$vWMin6OUcGFTFl67o7sO1ukDx9Pqjh1lZFtin4EysaCrNTA2H/xKy",
    "repository": "team-xquare/v1-service-meal",
    "type": "be",
    "createAt": "2023-08-12T05:12:45Z",
    "lastUsedAt": "2023-09-12T00:51:33Z",
    "lastRequestSucceed": true,
    "club": "xquare",
    "useRedis": true,
    "useMySQL": true
  },
  {
    "id": "0e10d960-e169-4003-97d4-bc516be0ac5b",
    "koName": "게시판",
    "name": "feed",
    "accessKey": "$2a$10$9s30THzyWJFcrJJQ1rym0.GjcX/rcXg62IgwY1Zmpe.ZDV.XWAGry",
    "repository": "team-xquare/xquare-frontend",
    "type": "fe",
    "createAt": "2023-08-12T04:46:21Z",
    "lastUsedAt": "2023-09-20T13:09:27Z",
    "lastRequestSucceed": true,
    "club": "xquare",
    "useRedis": true,
    "useMySQL": true
  },
];

export const ProjectList = () => {

  const [secret, setSecret] = useState('');

  useEffect(() => {
    const currentURL = new URL(window.location.href);
    const searchParams = currentURL.searchParams;
    setSecret(searchParams.get('secret'))
  }, []);

  if (process.env.get("SECRET") != secret) return (<></>);

  return (
    <div className="bg-gray-100 p-4">
      <h1 className="text-2xl font-bold mb-4">API Response</h1>
      <table className="min-w-full divide-y divide-gray-200">
        <thead className="bg-gray-50">
          <tr>
            <TableHeaderCell value="Korean Name" />
            <TableHeaderCell value="Name" />
            <TableHeaderCell value="Repository" />
            <TableHeaderCell value="Type" />
            <TableHeaderCell value="Created At" />
            <TableHeaderCell value="Last Used At" />
            <TableHeaderCell value="Last Request Succeed" />
            <TableHeaderCell value="Club" />
            <TableHeaderCell value="Use Redis" />
            <TableHeaderCell value="Use MySQL" />
          </tr>
        </thead>
        <tbody className="bg-white divide-y divide-gray-200">
          {data.map((item) => (
            <tr key={item.id}>
              <TableDataCell value={item.koName} />
              <TableDataCell value={item.name} />
              <TableDataCell value={item.repository} />
              <TableDataCell value={item.type} />
              <TableDataCell value={item.createAt} />
              <TableDataCell value={item.lastUsedAt} />
              <TableDataCell value={item.lastRequestSucceed ? 'Yes' : 'No'} />
              <TableDataCell value={item.club} />
              <TableDataCell value={item.useRedis ? 'Yes' : 'No'} />
              <TableDataCell value={item.useMySQL ? 'Yes' : 'No'} />
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
